import { Container, ListGroup, } from 'react-bootstrap';
import StarBorderIcon from '@mui/icons-material/StarBorder';

const ResponsePagination = (props) => {

    return (
        <Container >
            <ListGroup as="ul">
                {props.data.map((el) => (
                        <ListGroup.Item key={el.id} as="li" action href='#link{el.id}'  className='d-flex justify-content-between'><div>{el.name}</div> <div><StarBorderIcon /></div></ListGroup.Item>
                ))}</ListGroup>
        </Container>

    );
};

export default ResponsePagination;
